import { LoginError } from './Types';

type State = ReadonlyArray<LoginError>;

const models = {
  state: [] as State,
  reducers: {
    errors: (state: State, payload: LoginError) => (State) => {
      return {
        ...state,
        errors: payload,
      };
    },
  },
};

export default models;
